import React, { useState, useEffect } from 'react';

function App() {
  const [tokenPrices, setTokenPrices] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  const cardData = [
    {
      title: 'Total Transactions',
      value: '1,234',
      change: '+12.3% from last month',
      icon: 'ðŸ“ˆ'
    },
    {
      title: 'Active Wallets',
      value: '567',
      change: '+5.7% from last month',
      icon: 'ðŸ‘¥'
    },
    {
      title: 'Gas Usage',
      value: '890 ETH',
      change: '-3.2% from last month',
      icon: 'â›½'
    }
  ];

  const fetchTokenPrices = async () => {
    const response = await fetch("http://localhost:5000/token-prices");
    const data = await response.json();
    setTokenPrices(data);
  };

  const handleAnalyze = () => {
    if (isLoading) return;

    setIsLoading(true);

    // Simulate loading delay
    setTimeout(() => {
      setIsLoading(false);
    }, Math.random() * (3000 - 1000) + 1000);
  };

  // useEffect for scroll animations
  useEffect(() => {
    const observer = new IntersectionObserver((entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting && entry.target.style) {
          entry.target.style.opacity = '1';
          entry.target.style.transform = 'translateY(0)';
        }
      });
    });

    // Observe all cards
    document.querySelectorAll('.card').forEach((card) => {
      card.style.opacity = '0';
      card.style.transform = 'translateY(20px)';
      card.style.transition = 'all 0.5s';
      observer.observe(card);
    });

    // Cleanup observer on component unmount
    return () => observer.disconnect();
  }, []); // Empty dependency array means this runs once on mount

  return (
    <div>
      <nav>
        <div className="nav-container">
          <div className="nav-content">
            <div className="logo">QuantumLedger</div>
            <div className="nav-links">
              <a href="#dashboard" className="nav-link">Dashboard</a>
              <a href="#features" className="nav-link">Features</a>
              <a href="#contact" className="nav-link">Contact</a>
            </div>
          </div>
        </div>
      </nav>

      <div className="hero">
        <div className="hero-content">
          <h1 className="hero-title">Welcome to QuantumLedger</h1>
          <p className="hero-description">Your all-in-one blockchain analytics and governance platform</p>
          <button className="button">
            Get Started
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
              <line x1="7" y1="17" x2="17" y2="7"></line>
              <polyline points="7 7 17 7 17 17"></polyline>
            </svg>
          </button>
        </div>
      </div>

      <div className="dashboard">
        <div className="search-card">
          <div className="search-form">
            <input 
              type="text" 
              className="input" 
              placeholder="Enter wallet address (0x...)" 
            />
            <button 
              className="button" 
              onClick={handleAnalyze}
              disabled={isLoading}
            >
              {isLoading ? (
                <>
                  <span className="spinner">âŸ³</span>
                  Analyzing...
                </>
              ) : (
                'Analyze'
              )}
            </button>
          </div>
        </div>

        <div className="card-grid">
          {cardData.map((card, index) => (
            <div key={index} className="card">
              <div className="card-header">
                <div className="card-title">{card.title}</div>
                <div>{card.icon}</div>
              </div>
              <div className="card-value">{card.value}</div>
              <div className="card-change">{card.change}</div>
            </div>
          ))}
        </div>

        {/* Token Prices Section */}
        <div className="token-prices">
          <button onClick={fetchTokenPrices}>Get Token Prices</button>
          <ul>
            {tokenPrices.map((token, index) => (
              <li key={index}>
                {token.name}: ${token.price}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default App;
